def heap_queue_largest(nums,n):
    if len(nums) == 0:
        return []

    heap = []
    # Iterate through the given array and insert elements into the heap
    for i in range(n):
        heapq.heappush(heap, nums[i])

    # Iterate through the array until k elements are extracted
    for i in range(n, len(nums)):
        if nums[i] < heap[0]:
            heapq.heappop(heap)
            heapq.heappush(heap, nums[i])

    # Return the three largest numbers in the heap
    return heapq.nlargest(n, heap)

